import React from "react";

const RecentProducts = () => {
  return (
    <section className="">
      <div className="">
        <svg width="25" height="25" xmlns="http://www.w3.org/2000/svg">
          <circle cx="25" cy="25" r="10" fill="#8FD3D4" />
        </svg>
      </div>
    </section>
  );
};

export default RecentProducts;
